import React from 'react'

export default function WorkoutItem(props) {


const opneWorkoutPage = () =>{
  props.thisCurrentWorkout(props.workout)
  props.changePage("workout")
}
    

  return (
    <div>
      <button className='workoutButton' onClick ={opneWorkoutPage} disabled={props.workout.isDone}>
        <h4>Workout N.O {props.workout.wNumber}</h4>
        <p>{props.workout.km} KM </p>
      </button>
    </div>
  )
}
